const FormHeader = ({ title }) => {
  return (
    <Row>
      <Col className="form-header" xs={12}>
        <hr className="form-title-separator" />
        <h1>{title}</h1>
        <hr className="form-title-separator" />
      </Col>
    </Row>
  );
};

export default FormHeader;
